import React, { Component } from 'react'
import { Card, Button, Table, Space } from 'antd'
import {
    PlusOutlined
} from '@ant-design/icons';
import LinkButton from '../../../components/LinkButton';

export default class SiteInfo extends Component {
    render() {

        const columns = [
            {
                title: '车次',
                dataIndex: 'trainNumber',
                key: '1',
                align: 'center',
            },
            {
                title: '类别',
                dataIndex: 'type',
                key: '2',
                align: 'center',
            },
            {
                title: '起点',
                dataIndex: 'start',
                key: '3',
                align: 'center',
            },
            {
                title: '终点',
                key: '4',
                dataIndex: 'end',
                align: 'center',
            },
            {
                title: '发车时间',
                key: '5',
                dataIndex: 'startTime',
                align: 'center',
            },
            {
                title: '耗时',
                key: '6',
                dataIndex: 'timeConsume',
                align: 'center',
            },
            {
                title: '车厢',
                key: '7',
                dataIndex: 'carriageNumber',
                align: 'center',
            },
            {
                title: '状态',
                key: '8',
                dataIndex: 'state',
                align: 'center',
            },
            {
                title: '操作',
                key: '9',
                render: () => (
                    <Space size="middle">
                        <LinkButton onClick={this.showUpdateModal}>编辑</LinkButton>
                    </Space>
                ),
                align: 'center'
            },
        ];

        const data = [
            {
                key: '1',
                trainNumber: '001',
                type: '动车',
                start: '起点',
                end: '终点',
                startTime: '08:30',
                timeConsume: '8',
                carriageNumber: '10',
                state: '启用',
            },
        ]

        return (
            <div>
                <Table
                    columns={columns}
                    dataSource={data}
                    bordered
                    rowKey="key"
                />
            </div>
        )
    }
}
